INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(1, 'Messenger', 0, 'Facebook Messenger es la aplicación de mensajería oficial de Facebook, que nos permitirá entablar conversaciones de texto con todos nuestros amigos dentro de la popular red social. Gracias a ella podremos enviar y recibir mensajes de texto, que además luego podremos continuar desde el ordenador.', 'Facebook Corporation', 1, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(2, 'Pokemon GO', 0, 'Pokémon GO es el primer gran juego de la franquicia Pokémon en aterrizar en Android. Y lo hace de la mano de Niantic —desarrolladores de Ingress— con un título que combina la tradicional magia de los juegos de Nintendo, con las buenas ideas demostradas en su opera prima. El resultado: una aventura en la que tendremos que salir a la calle y movernos si realmente queremos convertirnos en entrenadores Pokémon.', 'Niantic, Inc', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(3, 'Clash Royale', 0, 'Los personajes de Clash of Clans se enfrentan en duelos.\r\nClash Royale es un juego de estrategia en tiempo real, en el que podremos enfrentarnos contra otros jugadores a través de Internet, en frenéticos duelos protagonizados por los míticos personajes de Clash of Clans. Encontraremos a los gigantes, los caballeros, los esqueletos con bombas, las arqueras, y a todos los demás.\r\n', 'Supercell', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(4, 'Geometry Dash', 0, 'Geometry Dash es un juego de plataformas en dos dimensiones en el que los jugadores controlarán a un cuadrado que debe llegar al final de varios niveles esquivando montones de obstáculos por el camino.', 'RobTop Games', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(5, 'FIFA 16 Ultimate Team', 0, 'FIFA 16 Ultimate Team es la entrega anual de la saga FIFA para terminales Android, a la que ya estamos tan acostumbrados. Como es de esperar, esta nueva entrega nos permitirá disfrutar de varios modos de juego distintos, incluyendo el popular ''Ultimate Team''. \r\n', 'EA Swiss Sarl', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(6, 'Riptide GP: Renegade', 4, 'Experimenta el futuro de las carreras ilegales de motos acuáticas, en las que pilotos con armadura realizan acrobacias que desafían a la muerte sobre enormes cataratas, escapan de la policía a través de los canales públicos y aceleran a velocidades de vértigo por las encrespadas olas.', 'Vector Unit', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(7, 'Crashlands', 18, '"... Una obra maestra de diseño." 5/5 - TouchArcade\r\nCraft, batalla, y la búsqueda de camino a Crashlands, un extravagante, historia basada en la Elaboración de RPG rebosante de Sass!', 'Butterscotch Shenanigans', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(8, 'THE KING OF FIGHTERS ''97', 11, 'Conviertase en el nuevo Challenger en el clásico absoluto THE KING OF FIGHTERS ''97 para Android!\r\nVuelva a visitar esta joya del género, encarnando un de los legendarios (ya veces ocultos) equipos del juego, y derrota a Orochi para conseguir uno de los muchos finales !\r\nPoner fin a los planes de resurrección de Orochi y decida cuál de Kyo Kusanagi o Iori Yagami tendrá la última palabra!', 'SNK PLAYMORE', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(9, 'Grand Theft Auto III', 17, 'La épica criminal que cambiará los juegos de mundo abierto para siempre.\r\nBienvenido a Liberty City. Donde todo empezó.\r\n\r\nRockstar Games celebra el 10º aniversario de uno de los juegos más influyentes de todos los tiempos. Grand Theft Auto III, el superventas aclamado por la crítica, llega a los dispositivos móviles para dar vida a los oscuros y sórdidos bajos fondos de Liberty City. El enorme y variado mundo abierto que ofrece el juego, así como un reparto de personajes disparatados de todos los estratos sociales y la libertad para explorarlo todo, ponen el intrigante y cruel mundo del crimen al alcance de tu mano.', 'Rockstar Games', 2, ),
(10, 'ePSXe for Android', 12, 'ePSXe for Android es un emulador de Playstation (PSX y PSOne). Es una versión para Android del conocido emulador ePSXe para PC. ePSXe provee muy alta compatibilidad y una buena velocidad. Se ha diseñado para smartphones y tablets (de 1-4 jugadores), e incluye un divertido modo para 2 jugadores para tablets. Include soporte para mandos virtuales en la pantalla táctil, y mapeo de mandos físicos(Xperia Play, Smartphones con teclado o controles, y mandos externos como el WiiMote, Sixaxis, Xbox 360, Moga, Ipega) con soporte de controles analógicos.\r\nePSXe for Android incluye gráficos mejorados mediante OpenGL gracias al Plugin Peopsxgl, lea la documentación para conocer como configurarloion (Menu->Info).', 'epsxe software s.l.', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(11, 'Modern Combat 4: Zero Hour', 1, 'El número 1 de los juegos FPS está de vuelta para smartphone con un nuevo capítulo para llevar más allá los límites de los juegos para dispositivos móviles. En los albares de una guerra nuclear, la única posibilidad para evitar una debacle global está en las manos de unos cuantos soldados de élite. Su misión es encontrar a un desgraciadamente conocido grupo terrorista y rescatar a los líderes mundiales.', 'Gameloft', 2, );
INSERT INTO `aplicacion` (`idaplicacion`, `nombre`, `precio`, `descripcion`, `desarrollador`, `categoria`, `foto`) VALUES
(12, 'Assassin''s Creed Identity', 15, 'Juega al primer juego de acción RPG de la aclamada serie ASSASSIN''S CREED. \nExplora el RENACIMIENTO ITALIANO a través de los ojos de TU PROPIO ASESINO, completa un montón de misiones y resuelve el misterio épico de Los Cuervos.', 'Ubisoft Entertainment ', 2, ),
(13, 'Cerrar Sesion', 13, 'Cierra Sesio n', 'Cato', 1, );

